      <div className='location-left-container' style={{float:'left' , width : '50%' , backgroundColor:'black' , height:'100%'}}>
        <div className='location-left-event-image' style={{width: '100%', margin:'10px' , height:'30%' , backgroundColor:'white'}}>
                <img src='https://upload.wikimedia.org/wikipedia/commons/1/18/React_Native_Logo.png' width={'100%'} alt = "image"/>
            
        </div>
      </div>
      <div className='location-right-container' style={{float:'right' , width:'50%' , backgroundColor : 'red', height:'100%'}}>
        <p> Prooo </p>
      </div>
    </div>
  );
}

